import React from 'react';
import MyImage from './spoti.png';
import './SpotifyPlaylistButtons.css';

const SpotifyPlaylistButtons = ({ playlists }) => {
  return (
    <div className="row">
      <div className="col-8">
        <div className="text-container">
          <div className="row">
            <div className="col-5">
              <h2>Disfruta de las mejores playlist en Spotify con nosotros</h2>
            </div>
            <div className="col-7">
              <div className="button-container">
                {playlists.map((playlist, index) => (
                  <a key={index} href={playlist.link} target="_blank" rel="noopener noreferrer">
                    <button className="playlist-button">
                      <img
                        src="https://example.com/spotify-icon.png" // Agrega la URL de tu propio icono de Spotify
                        alt="Spotify Icon"
                        className="spotify-icon"
                      />
                      <span>{playlist.name}</span>
                    </button>
                  </a>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>
      <div className="col-4">
        <div className="image-container">
          <img src={MyImage} alt="Internet Image" className="spotify-image" />
        </div>
      </div>
    </div>
  );
};

export default SpotifyPlaylistButtons;
